import React from 'react';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Header from './Header';
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import Unit from './Unit';
import './App.css';

function App() {
  const topics = [
    ['Types of Variables', 'Converting Categorical Data into Numeric Data'],
    ['K-Means', 'Principal Component Analysis (PCA)']
  ];
  const subUnitList = topics.map((list, unitIndex) => list.map((title, subUnitIndex) => <li><Link to={`/unit${unitIndex}_${subUnitIndex}`} className='subunit'>{title}</Link></li>));
  const subUnitRoutes = topics.map((list, unitIndex) => list.map((title, subUnitIndex) => <Route path={`/unit${unitIndex}_${subUnitIndex}`} element={<Page unit={unitIndex} index={subUnitIndex} />}></Route>));
  return (
    <div>
      <BrowserRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          {topics.map((list, index) => <Route path={`/unit${index}`} element={<Unit unit={index+1} subUnitList={subUnitList[index]}/>}></Route>)}
          {/* <Route path="/unit1" element={<Unit unit={1} />} />
          <Route path="/unit2" element={<Unit unit={2} />} />
          <Route path="/unit3" element={<Unit unit={3} />} />
          <Route path="/unit4" element={<Unit unit={4} />} /> */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
